def ascii_to_str(s):
    ascii_pattern = re.compile(r"(%[^%]{2})")
    ascii_result = re.findall(ascii_pattern, s)
    for item in ascii_result:
        ascii_str = chr(int(item[1:], 16))
        s = s.replace(item, ascii_str)
    return s

