def zh_to_ascii(s):
    """
        中文转换为淘宝地址中的 ASCII
    """
    bytes_diannao = s.encode('utf-8')
    ascii_str = str(bytes_diannao).replace('\\x', '%')
    ascii_str = ascii_str.replace('b', '')
    ascii_str = ascii_str.replace("'", '')
    print(ascii_str.upper())
    print(bytes_diannao.decode('utf-8'))

